import './App.scss';
import './variables.scss';
import React, { useMemo, useState } from 'react';
import Header from './Header/Header';
import About from './About/About';
import Projects from './Projects/Projects';
import Experience from './Experience/Experience';
import Education from './Education/Education';
import Skills from './Skills/Skills';
import Contact from './Contact/Contact';
import Sidebar from './Sidebar/Sidebar';
import { joinStrings } from './utils/utils';

function App() {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const Components = useMemo(() => {
    const comp = {
      Header: React.lazy(() => import('./Header/Header')),
      About: React.lazy(() => import('./About/About')),
      Projects: React.lazy(() => import('./Projects/Projects')),
      Experience: React.lazy(() => import('./Experience/Experience')),
      Education: React.lazy(() => import('./Education/Education')),
      Skills: React.lazy(() => import('./Skills/Skills')),
      Contact: React.lazy(() => import('./Contact/Contact')),
    };

    for (const key in comp) {
      comp[key].displayName = key;
    }
  }, []);

  return (
    <div className='app'>
      <Sidebar
        isSidebarOpen={isSidebarOpen}
        setIsSidebarOpen={setIsSidebarOpen}
      />
      <main
        className={joinStrings([
          'app__body',
          isSidebarOpen && 'app__body--sidebar-open',
        ])}
      >
        <Header />
        <About />
        <Projects />
        <Experience />
        <Education />
        <Skills />
        <Contact />
      </main>
    </div>
  );
}

export default App;
